-- INSERT INTO `sub_questions` VALUES (4,125,'TomJerry','select `name`,`amount` from blank_data where name=\'Tom\' or name=\'Jerry\';','2020-11-16 07:17:06','2020-12-28 17:33:56',1,0,0),(5,125,'TomJerry','select `name`,`address` from address_data where name=\'Tom\' or name=\'Jerry\';','2020-11-16 07:18:08','2020-12-30 10:40:34',1,0,0),(10,1,'sql1000eno','select w.eno \nfrom works w\ngroup by w.eno\nhaving sum(hours) > 1000;','2020-11-25 12:49:46','2022-04-21 20:11:22',1,0,0),(11,1,'sqleno','select e.eno\nfrom employees e\nwhere not exists (\n	select *\n	from relations r\n	where r.eno = e.eno\n);','2020-11-25 12:50:18','2021-04-10 20:10:36',1,0,0),(12,1,'sqlpno','select p.pno\nfrom projects p\nwhere not exists (\n    select * \n    from employees e\n    where not exists(\n        select *\n        from works w\n        where w.eno = e.eno and w.pno = p.pno\n    )\n)','2020-11-25 12:51:08','2021-03-30 21:59:30',1,0,0),(13,1,'sqldnoenosalarydno','select e1.dno,e1.eno, e1.salary\nfrom employees e1\nwhere e1.salary in (\n	select MAX(salary)\n	from employees e2\n	where e1.dno = e2.dno\n	group by dno\n)\norder by dno;','2020-11-25 12:53:41','2021-03-30 22:01:33',2,1,0),(14,2,'sql352020-09-012020-09-30REDsname','select s.sname from sailors s\nwhere s.age > 35 and not exists (\n	select * \n	from reserves r join boats b\n	on r.bid = b.bid \n	where  \n	r.sid = s.sid and \n	b.color = \'RED\' and\n	(r.reserve_date between \'2020-09-01\' and \'2020-09-30\')\n);','2020-11-25 14:42:26','2021-04-07 11:13:59',1,0,0),(15,3,'sqlcustomer_id','select c.customer_id\nfrom customers c\nwhere not exists (\n    select * \n    from products p\n    where not exists (\n        select * \n        from orders o\n        where o.customer_id = c.customer_id and o.product_id = p.product_id\n    )\n);','2020-11-25 14:59:19','2021-03-30 22:11:51',1,0,0),(16,3,'sql2020-08-012020-08-31customer_idcustomer_idorder_num','select o.customer_id, count(distinct order_id) as order_num\nfrom orders o\nwhere o.order_date BETWEEN \'2020-08-01\' and \'2020-08-31\'\nGROUP BY o.customer_id\norder by order_num DESC, customer_id asc\nlimit 1;','2020-11-25 15:01:38','2021-04-06 23:58:13',2,0,0),(17,3,'sql()product_nameorder_idorder_dateproduct_name','SELECT\n	p.product_name AS product_name,\n	o.order_id,\n	o.order_date\nFROM\n	orders o,\n	customers c,\n	products p\nWHERE\n	o.customer_id = c.customer_id\nAND o.product_id = p.product_id\nAND (o.product_id, o.order_date) IN (\n	SELECT\n		product_id,\n		MAX(order_date)\n	FROM\n		orders\n	GROUP BY\n		product_id\n)\nORDER BY product_name;\n','2020-11-25 15:10:49','2021-03-30 22:07:24',2,1,0),(18,3,'sql3customer_nameorder_idorder_datecustromer_nameorder_date','SELECT c.name customer_name,o2.order_id,o2.order_date\nFROM orders o1,orders o2,customers c\nWHERE o1.customer_id=o2.customer_id AND c.customer_id=o2.customer_id\nGROUP BY c.name,o2.order_id,o2.customer_id,o2.order_date\nHAVING SUM(o1.order_date>=o2.order_date)<=3\nORDER BY c.name,o2.order_date desc;','2020-11-25 15:14:53','2021-03-30 22:11:35',2,1,0),(19,4,'sqlplayer_idplayer_idmatch_num','select player_id, count(*) as match_num from \n(\n	select p.player_id \n	from players p join matches m\n	on p.player_id = m.first_player or p.player_id = m.second_player\n) tot_player\ngroup by player_id\nORDER BY match_num DESC,player_id asc\nlimit 1;','2020-11-25 15:28:48','2021-03-30 22:13:15',2,0,0),(20,4,'sqlgroup_idmatch_num','select group_id, count(match_id) as match_num\nfrom matches\ngroup by group_id;','2020-11-25 15:31:30','2021-03-30 22:13:39',1,0,0),(21,4,'sqlmatch_idmatch_idsub0','select match_id, ABS(first_score - second_score) as sub\nfrom matches\norder by ABS(first_score - second_score) desc, match_id asc\nlimit 1;','2020-11-25 15:37:23','2021-03-30 22:14:39',2,0,0),(22,4,'sqlplayer_id group_idplayer_idgroup_id','select group_id,min(player_id) as player_id\nfrom\n    (select player,sum(score) as score\n    from\n        ((select first_player player,first_score score from matches)\n        union all\n        (select second_player player,second_score score from matches)) t\n    group by player) a\n    right join players p on a.player=p.player_id\nwhere (group_id,score) in\n(select group_id,max(score) as mx\nfrom \n    (select player,sum(score) as score\n    from\n        ((select first_player player,first_score score from matches)\n        union all\n        (select second_player player,second_score score from matches)) t\n    group by player) a\n    right join players p on a.player=p.player_id\ngroup by group_id)\ngroup by group_id\norder by group_id;','2020-11-25 15:39:59','2021-03-30 22:29:39',3,1,0),(23,5,'sqlorder_datenum','select order_date,count(*) as num\nfrom orders \ngroup by order_date\norder by num DESC,order_date asc\nlimit 1;','2020-11-25 15:46:15','2021-03-30 22:30:34',1,0,0),(24,5,'sqluser_id','select u.user_id \nfrom users u\nwhere exists (\n	select * \n	from orders o LEFT JOIN items i\n	on o.item_id = i.item_id\n	where o.buyer_id = u.user_id and u.favorite_brand = i.item_brand\n);','2020-11-25 15:47:57','2021-03-30 22:30:59',2,0,0),(25,5,'sql2019user_idjoin_dateorders_in_2019user_id','select user_id, join_date, count(order_id) orders_in_2019\nfrom users left join orders\non user_id = buyer_id and year(order_date)=\'2019\'\ngroup by user_id\norder by user_id;','2020-11-25 15:50:21','2021-04-07 11:54:25',2,1,0),(26,5,'sqlseller_idif_fav_brand\'yes\'\'no\'2 noseller_id','select user_id seller_id, if(favorite_brand = item_brand, \'yes\', \'no\') if_fav_brand\nfrom users left join (\n    select seller_id, item_brand\n    from (\n        select o1.seller_id, o1.item_id\n        from orders o1 join orders o2\n        on o1.seller_id = o2.seller_id\n        group by o1.order_id\n        having sum(o1.order_date > o2.order_date) = 1\n    ) o join items i\n    on o.item_id = i.item_id\n) tmp\non user_id = seller_id\norder by seller_id;','2020-11-25 16:15:32','2021-04-14 00:12:51',3,1,0),(27,6,'sqlaccept_rate2','select round(\n    ifnull(\n    (select count(distinct requester_id ,accepter_id) from accepted_requests) / \n    (select count(distinct sender_id ,send_to_id) from friend_requests)\n    ,0)\n    ,2) as accept_rate ;','2020-11-25 16:29:45','2021-04-10 21:29:14',2,0,0),(28,6,'sqluser_id','select distinct fr.sender_id user_id\nfrom friend_requests fr \nwhere exists (\n	select * from friend_requests fr2\n	where fr2.sender_id = fr.sender_id\n) and not exists (\n	select * from accepted_requests \n	where fr.sender_id = requester_id\n);','2020-11-25 16:30:33','2021-03-30 22:47:34',2,0,0),(29,6,'sqlmonaccept_rate0mon','select t1.m1 as mon, t1.accept/t2.alla accept_rate from\n(select month(accept_date) m1, count(distinct concat(requester_id, accepter_id)) accept\nfrom accepted_requests \ngroup by month(accept_date)) t1\ninner join\n(select month(request_date) m2, count(distinct concat(sender_id, send_to_id)) alla\nfrom friend_requests \ngroup by month(request_date)) t2\non t1.m1=t2.m2\norder by mon;','2020-11-25 16:34:38','2021-03-30 22:48:20',2,1,0),(30,6,'sqluser_iduser_idfriend_num','select user_id, count(*) friend_num\nfrom \n((select requester_id user_id\nfrom accepted_requests\n)\nunion all\n(select accepter_id user_id\nfrom accepted_requests)) t3\ngroup by user_id\norder by friend_num desc,user_id asc\nlimit 1;','2020-11-25 16:36:42','2021-03-30 22:48:56',2,0,0),(31,7,'sqlidid','SELECT distinct author_id as id\nFROM views\nWHERE author_id = viewer_id\nORDER BY author_id;','2020-11-25 16:44:02','2021-03-30 22:52:20',1,1,0),(32,7,'sqlviewer_idviewer_id','select  distinct viewer_id from views \ngroup by viewer_id,view_date\nhaving count(distinct article_id) >= 2\norder by viewer_id;','2020-11-25 16:45:09','2021-03-30 22:53:20',2,1,0),(33,7,'sqlview_idviewer_idarticle_num','select viewer_id , count(*) as article_num  from views \ngroup by viewer_id \norder by article_num desc, viewer_id asc\nlimit 1;','2020-11-25 16:47:33','2021-04-07 00:20:29',2,0,0),(34,7,'sql2020-08-012020-08-313idid','select distinct viewer_id as id\nfrom views v1  \nwhere exists(\n	select *\n	from views v2\n	where v2.viewer_id = v1.viewer_id and v2.author_id = 3\n				and (v2.view_date BETWEEN \'2020-08-01\' and \'2020-08-31\')\n)\norder by id;','2020-11-25 16:48:57','2021-04-07 11:16:15',2,1,0),(35,8,'sqluser_iddateuser_id','SELECT user_id, MAX(login_date) as date FROM logins\nGROUP BY user_id\nORDER BY user_id;','2020-11-25 18:08:13','2021-03-30 22:54:43',1,1,0),(36,8,'sql12rate','select \ncount(distinct user_id)*1.0/(select count(distinct user_id) from logins) as rate\nfrom logins\nwhere (user_id,login_date)\nin (select user_id,DATE_ADD(min(login_date),INTERVAL 1 DAY) from logins group by user_id);','2020-11-25 18:09:23','2021-04-12 11:04:12',3,0,0),(37,8,'sql2login_datenew_user_numlogin_date','select l.mdate as login_date,count(user_id) as new_user_num\nfrom (\n    select user_id,min(login_date) as mdate\n    from logins\n    group by user_id) as l\ngroup by l.mdate \nhaving new_user_num >= 2\norder by login_date;','2020-11-25 18:11:07','2021-03-30 22:55:57',2,1,0),(38,8,'sql0daterate3date','SELECT a.date, ROUND(COUNT(b.user_id) * 1.0/COUNT(a.user_id), 3) AS rate\nFROM (\n    SELECT user_id, MIN(login_date) AS date\n    FROM logins\n    GROUP BY user_id) a\nLEFT JOIN logins b\nON a.user_id = b.user_id\nAND b.login_date = DATE_ADD(a.date,INTERVAL 1 day)\nGROUP BY a.date\nUNION\nSELECT login_date date, 0.000 AS rate\nFROM logins\nWHERE login_date NOT IN (\n    SELECT MIN(login_date)\n    FROM logins\n    GROUP BY user_id)\nORDER BY date;','2020-11-25 18:16:53','2021-03-30 22:56:49',3,1,0),(39,9,'sqljobavg3avg','select job,round(sum(score)*1.0/count(user_id),3) as avg from grades\ngroup by job order by avg desc;','2020-11-25 18:51:53','2021-03-30 22:57:28',1,1,0),(40,9,'sqluser_idjobscoreuser_id','select grades.* from grades join \n(select job,round(sum(score)*1.0/count(user_id),3) as avg from grades\ngroup by job) as t\non grades.job=t.job\nwhere grades.score > t.avg\norder by user_id;','2020-11-25 18:52:57','2021-03-30 22:58:35',2,1,0),(41,9,'sqlstartend1 start = end end = start + 1job','SELECT job,FLOOR((COUNT(*)+1)/2) AS `start`,FLOOR((COUNT(*)+1)/2)+if(COUNT(*) % 2=1,0,1) AS `end` \nfrom grades\nGROUP BY job \norder by job;','2020-11-25 18:55:23','2021-04-07 00:07:37',1,1,0),(42,9,'sqluser_idjobscoret_rankuser_id','select B.* from\n(SELECT job,FLOOR((COUNT(*)+1)/2) AS `start`,FLOOR((COUNT(*)+1)/2)+if(COUNT(*) % 2=1,0,1) AS `end` \nFROM grades  GROUP BY job) A\nJOIN\n(select g1.*, (\n    select count(distinct g2.score) \n    from grades g2 \n    where g2.score>=g1.score and g1.job=g2.job) as t_rank\nfrom grades g1 ) B\non (A.job=B.job  and B.t_rank between A.start and A.end)\norder by B.user_id;','2020-11-25 18:56:14','2021-03-30 23:04:04',3,1,0),(43,10,'sqlTechnologydepartmentavg_salary','select d.department_name as department, AVG(e.salary) as avg_salary\nfrom employees e LEFT JOIN departments d\non e.department_id = d.department_id\nwhere d.department_name = \'Technology\'\ngroup by e.department_id;','2020-11-25 19:11:07','2021-03-30 23:04:25',1,0,0),(44,10,'sqldepartmentsub','select d.department_name department, MAX(salary)-MIN(salary) as sub\nfrom employees e LEFT JOIN departments d \non e.department_id = d.department_id\ngroup by e.department_id;','2020-11-25 19:12:40','2021-03-30 23:07:16',2,0,0),(45,10,'sqldepartmentnamesalarydepartment','select d.department_name as department,t.name,t.salary from \ndepartments d join \n(select name,salary,department_id from employees e1 where 1 = \n(select count(distinct(salary)) from employees e2 \nwhere e1.department_id = e2.department_id \nand e1.salary < e2.salary)) t\non d.department_id = t.department_id\norder by department;','2020-11-25 19:17:46','2021-03-30 23:04:59',3,1,0),(46,10,'sqldepartmentnamesalarydepartmentsalary','select d.department_name as department,e.name ,e.salary as salary\nfrom employees as e left join departments as d \non e.department_id = d.department_id\nwhere e.id in\n