02-28\')','2020-11-26 11:29:13','2020-12-30 11:01:55',2,0,0),(55,11,'eatingname','select friends.name \nfrom friends,activities\nwhere friends.activity=activities.activity and friends.activity=\'eating\'','2020-11-26 11:30:52','2021-04-13 21:36:47',1,0,0),(56,12,' 2020  2    title','select title from \n(select m.title,avg(mr.rating) as rt from movie_rating mr\ninner join movies m\non m.movie_id = mr.movie_id \ninner join users u \non u.user_id = mr.user_id \nwhere mr.created_at between \'2020-02-01\' and \'2020-02-29\'\ngroup by m.movie_id\norder by rt desc,m.title asc\nlimit 1) b','2020-11-26 11:33:33','2021-04-10 21:21:42',3,1,0),(57,12,' name','(SELECT name\nFROM users AS U\nINNER JOIN movie_rating AS MR\nON U.user_id = MR.user_id\nGROUP BY U.user_id\nORDER BY COUNT(*) DESC, name\nLIMIT 1)\n','2020-11-26 11:34:06','2021-04-10 12:05:40',3,1,0),(58,12,'movie_id, title, avg_rating, max_rating, min_rating','select movies.movie_id,title, avg(rating)as avg_rating, max(rating) as max_rating, min(rating) as min_rating\nfrom movies, movie_rating\nwhere movies.movie_id=movie_rating.movie_id\ngroup by movies.movie_id','2020-11-26 11:34:36','2021-04-12 10:35:12',2,0,0),(59,12,'name , title, created_at','select name, title,created_at\nfrom movie_rating,users,movies\nwhere movie_rating.created_at between \'2020-01-01\' and \'2020-01-31\' and movie_rating.movie_id=movies.movie_id and movie_rating.user_id=users.user_id','2020-11-26 11:35:06','2020-12-30 11:03:00',2,0,0),(60,12,'id1user_idnametitlerating','select movie_rating.user_id,name,title,rating\nfrom users,movie_rating,movies\nwhere movies.movie_id=movie_rating.movie_id and movie_rating.user_id=users.user_id and movie_rating.user_id=1','2020-11-26 11:35:30','2021-04-10 20:55:55',1,0,0),(61,13,'IDinvoice_idprice, user_idcustomer_name','select invoice_id,price,invoices.user_id,customer_name\nfrom invoices,customers\nwhere invoices.user_id=customers.customer_id and price=(select max(price) from invoices)','2020-11-26 11:50:08